Allie Haze, Alyssa Branch, Chad Alva, Kimberly Kane, Lexi Belle, Lexi Bloom, Tony DeSergio, Xander Corvus, Zoe Voss


What would you do to find love? In Lost and Found, David (Xander Corvus), a swinging bachelor who's tired of his old ways, can't believe his luck when Jen (Allie Haze) moves in next door. After being uncharacteristically at a loss for words, David is helped by his roommate, Steve (Chad Alva), who devises a scheme that is certain to bring Jen and David together. Is there no limit to what a man will do for a shot at love? Find out in this adorable romance about a man, a woman and the little pup that brought them together by nearly tearing them apart.
